<style>
.hero {
  width: 100%;
  height: 100vh;
  position: relative;
  overflow: hidden;
}
.hero___thumbnail {
  position: absolute;
  bottom: 100px;
  right: -40px;
}
.hero___thumbnail svg {
  max-inline-size: none;
  transform: rotate(-90deg);
  width: calc(357 / 375 * 100vw);
}
@media screen and (min-width: 768px) {
  .globalNav__item + .globalNav__item {
    margin-top: calc(20 / 16 * 1rem);
  }
  .hero___thumbnail {
    /* left: 527px; */
    top: 300px;
    bottom: 0;
    right: calc(207 / 1440 * 100vw);
    /* right: calc(206 / 1440 * 100vw); */
  }
  .hero___thumbnail svg {
    transform: rotate(0deg);
    max-inline-size: none;
    width: calc(707 / 1440 * 100vw);
  }
}
.hero__ramdom path {
  opacity: 0;
  filter: blur(5px);
}
.hero__name {
  display: block;
  opacity: 0;
  clip-path: "inset(0 0 100% 0)";
  /* clipPath: "polygon(0 0, 100% 0, 100% 100%, 0 100%)", */
  /* clip-path: polygon(0 100%, 100% 100%, 100% 100%, 0 100%); */
}
</style>
<script>
import gsap from "gsap";
if (process.browser) {
  const name = document.querySelectorAll(".hero__ramdom path");
  const name2 = document.querySelector(".hero__name");
  const tl = gsap.timeline();
  // gsap.set(name2, {
  //   clipPath: "inset(0 0 100% 0)",
  // });
  tl.to(name, {
    opacity: 1,
    filter: "blur(0px)",
    ease: "power2.in",
    duration: 0.7,
    stagger: {
      each: 0.1, // 遅延させる時間
      from: "random", // 開始位置の指定 start, end, center, edges, random
    },
  }).to(".hero__name", {
    duration: 0.7,
    ease: "power2.in",
    opacity: 1,
    clipPath: "inset(0)",
  });
}
</script>
